import React from 'react';
import { useHistory } from 'react-router-dom';

const LogoutConfirmPage = () => {
  const history = useHistory();

  const handleCompleteLogout = () => {
    localStorage.clear();
    window.location = '/homepage'; // Redirect to homepage
  };

  const handleCancelLogout = () => {
    history.push('/'); // Navigate back to the home page or previous page
  };

  return (
    <div className="logout-confirm">
      <p>Are you sure you want to logout?</p>
      <button onClick={handleCompleteLogout}>Yes</button>
      <button onClick={handleCancelLogout}>No</button>
    </div>
  );
};

export default LogoutConfirmPage;
